import React from 'react';
import styled from 'styled-components';

import { BUTTON_TRANSPARENT,
         BUTTON_TRANSPARENT_D,
         BUTTON_TRANSPARENT_N
          } from '../../../Styles/Button'
         
const StyledDiv = styled.div`
  width: 60%;
  margin: 16px auto;
  border: 1px solid #eee;
  box-shadow: 0 2px 3px #ccc;
  padding: 16px;
  text-align: center;
  
  @media (min-width: 500px) {
    width: 450px;
  }
`;


const Hea = () => {
    

        return (
            <StyledDiv>
            <div >
                <h1 style={BUTTON_TRANSPARENT}> Health services </h1>
                <h3 style={BUTTON_TRANSPARENT_D}> 1 - chirurgical operations </h3>
                <p style={BUTTON_TRANSPARENT_N}> 25 % of the value of operations <br></br> ( only under 150.000 DZD)
                        for school teachers and workers and their relatives ( sons 21 years and daughter until got married)  </p>
                <h3 style={BUTTON_TRANSPARENT_D}> 2 - Hammam ( mineral bath ) </h3>
                <p style={BUTTON_TRANSPARENT_N}> 25 % of the value for hammams <br></br>( only under 50.000 DZD ) </p>
            </div>
            </StyledDiv>
            )
        }
  

export default Hea ;
